script: |
  super -f text -I q13690.spq | sort > q13690.out

inputs:
  - name: q13690.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) AS cor0 WHERE col2 * - col0 NOT BETWEEN + - col1 + - col2 AND col1 * + CAST ( NULL AS INTEGER ) / + + col2;
  - name: tab1

outputs:
  - name: q13690.out
    data: |
      51	14	96
      85	5	59
      91	47	68
